INSERT INTO `HALLS` VALUES (8,'2023-03-04 21:26:03.445262','Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.','Dolby Atmos-A01',20,10,'2023-03-04 21:26:03.445279',1),(9,'2023-03-04 21:26:44.905150','Οι “Village Kids” είναι ειδικά διαμορφωμένες αίθουσες πρωτίστως για παιδιά που υπόσχονται να προσφέρουν μοναδικές στιγμές σε όλη την οικογένεια με τις καλύτερες νέες παιδικές ταινίες του παγκόσμιου κινηματογράφου σε πρώτη προβολή.','VKids-A02',10,5,'2023-03-04 21:29:47.181473',1),(10,'2023-03-04 21:27:11.122592','Στην Vmax των Village Cinemas στο The Mall Athens με την αποκλειστική εφαρμογή του premium μοντέλου \'Sphera\'. Η νέα αίθουσα \'Vmax Sphera\', η πρώτη στο είδος της στην Ευρώπη, υπόσχεται να αλλάξει την κινηματογραφική εμπειρία, με μία σειρά καινοτόμων τεχνολογικών και αισθητικών επιτευγμάτων.','Vmax Sphera-A03',22,18,'2023-03-04 21:29:51.855458',1),(11,'2023-03-04 21:28:30.195801','Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.','Dolby Atmos-B01',18,8,'2023-03-04 21:28:30.195805',2),(12,'2023-03-04 21:28:59.047849','Οι “Village Kids” είναι ειδικά διαμορφωμένες αίθουσες πρωτίστως για παιδιά που υπόσχονται να προσφέρουν μοναδικές στιγμές σε όλη την οικογένεια με τις καλύτερες νέες παιδικές ταινίες του παγκόσμιου κινηματογράφου σε πρώτη προβολή.','VKids-B02',9,4,'2023-03-04 21:30:07.087473',2),(13,'2023-03-04 21:30:29.681924','Στην Vmax των Village Cinemas στο The Mall Athens με την αποκλειστική εφαρμογή του premium μοντέλου \'Sphera\'. Η νέα αίθουσα \'Vmax Sphera\', η πρώτη στο είδος της στην Ευρώπη, υπόσχεται να αλλάξει την κινηματογραφική εμπειρία, με μία σειρά καινοτόμων τεχνολογικών και αισθητικών επιτευγμάτων.','Vmax Sphera-B03',20,16,'2023-03-04 21:30:29.681928',2),(14,'2023-03-05 14:33:41.733573','Dolby Atmos είναι η τεχνολογία που επιτρέπει την αναπαραγωγή ήχων στον τρισδιάστατο χώρο. Για να μπορέσει να συμβεί αυτό, μια κιν/κη αίθουσα εξοπλίζεται με ένα μεγάλο αριθμό ηχείων (έως 64 - ανάλογα το μέγεθος της) τα οποία είναι - σχεδόν - όλα ανεξάρτητα μεταξύ τους και τοποθετούνται όχι μόνο μπροστά και γύρω από την αίθουσα (όπως στα άλλα συστήματα ήχου 5.1 & 7.1) αλλά και πάνω στην οροφή της.','Dolby Atmos-C01!',18,12,'2023-03-05 14:33:49.388875',3);
